import Layout from '../components/Layout'
import Head from 'next/head';
import Navbar from '../components/Navbar';
import HeaderText from '../components/HeaderText';


function App(){
  return (
    <html>
      <Head>
        <title>Welcome to Header</title>
      </Head>
      <body>
        <Navbar />
        <Layout />
      </body>
    </html>
  )
}


export default App
